import React, { useState } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";

import Navbar from "./navbar";

function ChangePage() {
  const [email, setEmail] = useState(null);
  const [passwd, setPasswd] = useState(null);
  const [name, setName] = useState(null);
  const [code, setCode] = useState(null);
  const mystylee = {
    backgroundColor: "powderblue",
  };

  const history = useHistory();

  const onSubmitHandler = () => {
    const data = { name: name, email: email, password: passwd, code: code };
    axios.post("http://localhost:8080/tablechange", data);
    history.push("/student-login");
  };
  return (
    <div>
      <Navbar />
      <div className="container " style={mystylee}>
        <div className="row justify-content-center">
          <div className="col-11 col-lg-5">
            <div>
              <h1 className="font-weight-light text-center py-5">
                <span className="text-info">Student </span>Sign Up
              </h1>
            </div>
            <div className="form-group">
              <label htmlFor="name">Name *</label>
              <input
                type="name"
                name="name"
                className="form-control"
                onChange={(e) => setName(e.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="email">Email *</label>
              <input
                type="email"
                name="email"
                className="form-control"
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="password">Password *</label>
              <input
                type="password"
                name="passwd"
                className="form-control"
                onChange={(e) => setPasswd(e.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="name">Class Code*</label>
              <input
                type="classcode"
                name="code"
                className="form-control"
                onChange={(e) => setCode(e.target.value)}
              />
            </div>

            <button
              type="submit"
              className="btn btn-dark float-right"
              style={{ backgroundColor: "black" }}
              onClick={() => onSubmitHandler()}
            >
              Submit
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ChangePage;
